import React from 'react'
import Card from './Card'
import Sdata from './Sdata'

const App = ()=>{
    return(
    <>
        <div className='head'>
            <h1>BEST NETFLIX SERIES</h1>
        </div>
        <div id='card'>
            {Sdata.map((val) => {
                return (
                    <Card
                    key={val.id} 
                    imgsrc={val.imagesrc} 
                    stitle={val.stitle} 
                    ctit={val.ctitle} />
                );
            })}
        </div>
    </>
    )

}
export default App;
